import React from 'react';
import './index.css';
import './comadreja.scss';
import 'bootstrap/dist/css/bootstrap.css';

function App() {
  return (
    <div>
      <div className="card">
        <form>
          <div className="card-header"><h2>Registrar Empresa</h2></div>
          <div>
            <input className="form-control form-control-lg focus-secondary" type="text" id="empresaNombre" placeholder="Nombre de la empresa" />
          </div>
          <div className="row">
            <div className="col">
              <input className="form-control" type="email" id="empresaEmail" placeholder="correo de la empresa" />
            </div>
            <div className="col">
              <input className="form-control" type="text" id="empresaTelefono" placeholder="telefono de la empresa" />
            </div>
          </div>
        </form>
      </div>
    </div>
  );
}

export default App;
